import React from 'react';
import './user-address.styles.css';
import { connect } from 'react-redux';

class UserAddress extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            user: {
                "id": 6,
                "name": "Mrs. Dennis Schulist",
                "email": "Karley_Dach@jasper.info",
                "age": 40,
                "address": [
                    {
                        "street": "Norberto Crossing",
                        "suite": "Apt. 950",
                        "city": "South Christy",
                        "zipcode": "23505-1337"
                    },
                    {
                        "street": "Hoeger Mall",
                        "suite": "Apt. 692",
                        "city": "South Elvis",
                        "zipcode": "53919-4257"
                    },
                    {
                        "street": "Victor Plains",
                        "suite": "Suite 879",
                        "city": "Wisokyburgh",
                        "zipcode": "90566-7771"
                    }
                ],
                "phone": "1-477-935-8478 x6430"
            }
        }
    }

    render() {
        return (
            <div>
                {
                    this.state.user.address.map( (add, index) => {
                        return (
                            <div className="card border-secondary mb-3" key={add.zipcode}>
                                <div className="card-header">Address {index + 1}</div>
                                <div className="card-body text-secondary">
                                    <table className="table table-sm table-borderless">
                                        <tbody className="text-left">
                                            <tr>
                                                <td><strong>Street:</strong></td>
                                                <td>{add.street}</td>
                                            </tr>
                                            <tr>
                                                <td><strong>Suite:</strong></td>
                                                <td>{add.suite}</td>
                                            </tr>
                                            <tr>
                                                <td><strong>City:</strong></td>
                                                <td>{add.city}</td>
                                            </tr>
                                            <tr>
                                                <td><strong>Zipcode:</strong></td>
                                                <td>{add.zipcode}</td>
                                            </tr>
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        );
                    })
                }
            </div>
        );
    }
};

const mapStateToProps = (state) =>({
    curUser: state.currentUser
});

export default UserAddress;
